@myswitzerland #seaswitzerland #inlovewithswitzerland @ilove_lucerne #mylucerne #lakelucerneregion', 'Time machine POV: 2017 me vs last pic 2022 me. The first photo was me just thinking of trying this photography out for fun and had no expectations, putting my every heart to believe I could turn this into reality being a full-time job.

However, when I first started, there were tons of uncertainties, faced with fears and being afraid to take up even minor jobs because i thought i didn’t have enough acquired skills as I was still honing my craft. It was a progressive growth, every day I kept telling myself that I will be able to do this in the future. Combined with the environment i was in and having very little budget to travel overseas in the past, Singapore was the only playground and i am very lucky to call here my best foundation to build my digital presence. I started capturing the beauty in everyday life here and people started appreciating and even applying that, which in turn garnered attention from clients too.

Fast forward to the present, never will I imagine it would be more than just a full-time thing, photography became something i live and breathe - a brand of my own.

My approach now is to educate everyone that they can create beautiful photos/moments in the daily, in hopes that people can realise: hey you don’t need to be an expert to do what you love, take one step at a time and you will impact people around you and the society more than you know 😊

