['#HTH', 'Thank you @nathankleinstyling @francescabrazzo and @leighkeateshair for transforming me last night for the @attitudemag awards 💫⚡️✨ I won Ally of the Year! Thank you Darren and Cliff.
I believe that it is the minimum of human decency to allow people to be their true selves, love who they love and do both things without harm, danger or oppression.
The LGBTQ+ community is strong and resilient but the constant attacks from all angles, especially on trans people, is exhausting. So now more than ever us allies need to step up to the plate and shout louder than before to protect, support and show love to our fellow human beings.', '🧜‍♀️ How Long?', 'What was your favourite song from this era? #Halcyon', 'All By Myself. @madison_phipps', 'Take us all back to the Halcyon era \U0001f979 so excited to celebrate this special little record with you all later this month 🦋 x', '✨✨✨', '🖤', 'Thank you so much @bmi for honouring me with the President’s award last night. Want to give you a excerpt from my speech last night on this, if I may. 
The truth is, I couldn’t be more grateful to receive this accolade. I carved out my career from pretty much nothing, wrote songs from the age of 8, taught myself guitar at 14, moved out around 17. By my early twenties I was knocking down doors to be heard, worked two jobs at university, and saved whatever money I could to get the train to London to sing my songs at any open mic night that would have me. Having ambition is not a bad thing, despite it being made out to be when a woman has it. In fact, it is crucial! We should never be made to feel ashamed of it. 
 I know what it is to burn yourself out, to surrender everything in a world which has been built against you. The music industry is notoriously hard. I’ve felt the bias, I’ve felt the compromise, I’ve felt inequity. But whenever I see my peers breaking boundaries, and pushing the boundaries of creativity - in art, science, and business - I rejoice to see how far we continue to chip at the glass ceiling. I know that whatever you think you can do or believe you can do, the most important thing is to begin. I’m still here doing what I love , and I am forever thankful for my team and my fans- I have you guys to thank for that ❤️❤️❤️❤️', '✨💫', 'Date night with @wesgordon ❤️ 
