Artwork shot by @robrusling123', 'Thanks for having me again for the first time in blaaady ages NYC… feels marvellous to hear Easy Lover all over the radio 😃🇺🇸❤️ x', 'coming sooner than you think… ☀️', 'Thank you, Kokkola! ❤️‍🔥 @stellamccartney miss you xxx', 'Thank you Espoo, that was delightful 🖤✨ @madison_phipps', 'This weekend I travelled as a guest of President Zelensky and the first lady, Olena Zelenska to Kyiv to speak at the First Ladies Summit (and sing a little, somehow while I was there I learnt a beautiful and powerful song in Ukrainian, “Chervona Kalyna", a song of resistance). It has been one of the greatest honours. 
I was determined to be there in person to pay tribute to the bravery and resilience of the Ukranian People. I was inspired by a number of people, but particularly a young #fridaysforfuture climate activist @ilyess_ek who I met at the Nature and Climate talks in Stockholm a few weeks ago. Traumatised by the invasion of his country he nevertheless showed up at the UN talks determined to carry on his work.
 In fact every day as a @UNEP ambassador I am reminded of the immense contribution of Ukranian climate scientists, renewable energy experts and environmentalists of all type. They are living through an horrific war bankrolled by fossil fuels. They somehow find the grit to keep going, working and campaigning for all of humanity.
 So I always knew that if I got the chance, I would try to show up too. On the nighttrain to Kyiv I looked out of the window and could make out the endless fields… a reminder that the Ukraine is the breadbasket of the world, this bastion of culture, of science and humanity is also a cradle of resistance and courage and commitment.
 I can’t tell you what an emotional journey this has been. There’s too much to put into words right now but I stand in solidarity, awe and respect with the people of Ukraine. 🇺🇦', 'Thank you @spotify & @spotifyuk for welcoming me back with these 🤍can’t wait to share more with you soon but for now enjoy Easy Lover 💙 link in bio to listen now x', 'Two whole years since Brightest Blue 🥺 What is your favourite song? 💙', "The official music video for 'Easy Lover' ft. @bigsean is out now!! 💛✨ Link in bio

