“If someone else did the hard work to make this world as shitty as it is, that means we can do the hard work to make a new, better world. If they can f*ck it up we can fix it up. Buckle up, buttercup”
Jumpsuit made with recycled nylon… boots with chrome free leather and the wool is fully sustainable.✨⚡️', 'BLEACH YOU.', 'Forever grateful for @remiblack for dancing the anxiety away x', 'Yesterday I got to meet global youth enviro leaders face to face @stockholmplus50. As a @UNEP and @wwf ambassador I’ve been doing this for a while, but this was next level! It meant everything to me. 

They literally brave war zones, persecution and huge personal sacrifice to get to meetings like this. They fight for nature and climate, for US and our futures as well as theirs with a clear sighted courage that is humbling but also empowering – if they can give 100% commitment to reversing destruction of nature, why can’t we all step up? Are we just going to leave them to do all the work?! 

On the eve of #WorldEnvironmentDay celebrating 50 years of international climate action, the fact that humanity has youth activists like this gives me the greatest hope. Thanks to the amazing @UNyouthenvoy @jayathmadw and @juancelisgarcia pushing for youth leaders at every level of decision making - @stockholmplus50 is rumoured to have the greatest youth participation yet. But it’s not enough. We need it to be easier to participate. Why not at least 50% youth delegates at every step? Let’s invest in these earth defenders. These are the humans I want deciding the fate of our planet. 

(Also, I love hugs)

